script: |
  super -f text -I q10308.spq | sort > q10308.out

inputs:
  - name: q10308.spq
    data: |
      SELECT - col2 * + + col0 + - col1 + - ( + - 60 ) / + - col0 + - + 5 AS col1 FROM tab0 (FORMAT parquet) WHERE + col0 + - col1 + col2 NOT BETWEEN - col2 / + 40 AND + col2 - - 48;
  - name: tab0

outputs:
  - name: q10308.out
    data: |
      -795
      -896
      -9609
